'mail/chrome/messenger/messengercompose/composeMsgs.properties:12589' => 'அஞ்சலை அனுப்பும்போது வழு ஏற்பட்டது: SMTP சேவையகம் %S அறியப்படாதது. சேவையகம் பிழையாக தகவமைக்கப்பட்டிருந்தது. தயவுசெய்து உங்கள் SMTP சேவையக தகவமைத்தல்கள் சரியென்று உறுதிசெய்து மீண்டும் முயற்சிசெய்யவும்.',
