'mail/chrome/messenger/messengercompose/composeMsgs.properties:12587' => 'நீங்கள் அனுப்ப எத்தனித்த செய்தியின் பருமன் சேவையகத்தினுடைய global size limit(%d bytes)இனை மீறியுள்ளது.செய்தி அனுப்பட்டிருக்கவில்லை. செய்தியின் பருமனை குறைத்து மீண்டும் முயற்சி செய்யவும்.',
