'mail/chrome/messenger/messengercompose/composeMsgs.properties:12592' => 'SMTP சேவையகம் %S இற்கான இணைப்பின் நேரம் முடிவடைந்ததால் செய்தியை அனுப்ப முடியவில்லை. மீண்டும் முயற்சிசெய்யவும் அல்லது உங்கள் வலையமைப்பு நிர்வாகியைத் தொடர்புகொள்ளவும்.',
'mail/chrome/messenger/messengercompose/composeMsgs.properties:12593' => 'அறியப்படாத காரணத்தால் SMTP சேவையகம் %S இனைப் பாவித்து செய்தியை அனுப்ப முடியவில்லை. மீண்டும் முயற்சிசெய்யவும் அல்லது உங்கள் வலையமைப்பு நிர்வாகியைத் தொடர்புகொள்ளவும்.',
'mail/chrome/messenger/messengercompose/composeMsgs.properties:12590' => 'SMTP சேவையகம் %S இற்கான இணைப்பு வெற்றியளிக்காததினால் செய்தியை அனுப்ப முடியவில்லை. சேயைகம் கிடைக்கக்கூடியதாக இல்லை அல்லது SMTP இணைப்புகளை நிராகரிக்கின்றது. தயவுசெய்து உங்கள் SMTP சேவையக தகவமைத்தல்கள் சரியென்று உறுதிசெய்து மீண்டும் முயற்சிசெய்யவும் அல்லது உங்கள் சேவையக நிர்வாகியைத் தொடர்புகொள்ளவும்.',
'mail/chrome/messenger/messengercompose/composeMsgs.properties:12591' => 'SMTP சேவையகம் %S இற்கான இணைப்பு பரிமாற்றத்தின்போது இடைவழியில் இழக்கப்பட்டுள்ளதனால் செய்தியை அனுப்ப முடியவில்லை. மீண்டும் முயற்சிசெய்யவும் அல்லது உங்கள் வலையமைப்பு நிர்வாகியைத் தொடர்புகொள்ளவும்.',
'mail/chrome/messenger/messengercompose/composeMsgs.properties:12596' => '%S  இன் SMTP சேவையகம் தனி உரையை மட்டும் கொண்ட கடவுச்சொல்லை அனுமதுக்காது. &#39;கணக்கு அமைப்புகள் | சேவையகம் அமைப்புகள்&#39; ஆகியவற்றில் உள்ளது போன்று &#39;அத்தாட்சிப்படுத்தப்பட்ட முறை&#39; க்கு எற்ப &#34;மறைக்குறியீடாக்கப்பட்ட கடவுச்சொல்&#34; ஆக மாற்றுவதற்கு தயவுசெய்து முயற்சிசெய்க.',
'mail/chrome/messenger/addressbook/abMainWindow.dtd:newContactButton.tooltip' => 'புதிய முகவரிப்புத்தகத் தொடர்பை உருவாக்குக',
'mail/chrome/messenger/messengercompose/composeMsgs.properties:12594' => '%S  இன் SMTP சேவையகம் மறைக்குறியீடாக்கப்பட்டுள்ள கடவுச்சொல்லுக்கு ஆதரவளிக்காது. இந்த கணக்கை நீங்கள் தற்போது உருவாக்கியிருந்தால்,  &#39;கணக்கு அமைப்புகள் | சேவையகம் அமைப்புகள்&#39; ஆகியவற்றில் உள்ளது போன்று &#39;அத்தாட்சிப்படுத்தப்பட்ட முறை&#39; க்கு எற்ப &#39; கடவுச்சொல், transmitted insecurely&#39; ஆகியவற்றை தயவுசெய்து மாற்ற முயற்சி செய்க. அது வேலைக்கு உபயோகிக்கப்பட்டு தற்போது திடீரென மறுக்கப்பட்டால், இது எப்படி ஒருவருடைய கடவுச்சொல்லை திருடுவதற்கான ஒரு பொதுவான முறையாகும்.',
'mail/chrome/messenger/messengercompose/composeMsgs.properties:12595' => '%S  இன் SMTP சேவையகம் மறைக்குறியீடாக்கப்பட்டுள்ள கடவுச்சொல்லுக்கு ஆதரவளிக்காது. இந்த கணக்கை நீங்கள் தற்போது உருவாக்கியிருந்தால், &#39;கணக்கு அமைப்புகள் | சேவையகம் அமைப்புகள்&#39; ஆகியவற்றில் உள்ளது போன்று &#39;அத்தாட்சிப்படுத்தப்பட்ட முறை&#39; க்கு எற்ப &#34;சாதாரண கடவுச்சொல்&#34; ஆக மாற்றுவதற்கு தயவுசெய்து முயற்சிசெய்க. அது வேலைக்கு உபயோகிக்கப்பட்டு தற்போது திடீரென மறுக்கப்பட்டால், தயவுசெய்து மின்னஞ்சல் நிர்வாகி அல்லது வழங்குனரை தொடர்பு கொள்க.',
