'mail/chrome/messenger/FilterListDialog.dtd:stopFilters.accesskey' => 'S',
'mail/chrome/messenger/addressbook/ldapAutoCompErrs.properties:10081' => 'புரவலர் பெயர் மற்றும் போர்ட் எண் சரியானவை என்பதை உறுதி செய்தப்பிறகு, மீண்டும் முயற்சி செய்க, அல்லது உங்க ஸிஸ்டம் நிர்வாகியை தொடர்பு கொள்க. புரவலர் பெயர் மற்றும் போர்ட் எண் சரியானவையா என்பதை உறுதி செய்ய, பதிப்பி மெனுவில், விருப்பத்தேர்வுகளை தேர்ந்தெடுத்து, பிறகு அஞ்சல் மற்றும் செய்தித்தொகுதிகளை தேர்வு செய்து, பிறகு முகவரியாக்கலை தேர்வு செய்து, பதிப்பி அடைவுகளை சொடுக்கி, மற்றும் பயன்படுத்தப்படுகின்ற LDAP சேவையகத்தை தேர்வு செய்க. பதிப்பியை சொடுக்கி. புரவலர் பெயரை காட்ட பதிப்பி மீது சொடுக்குக. போர்ட் எண்ணை காட்ட உயர்தர என்பதை சொடுக்குக.',
